description:
Hurry up and run faster and faster! THEY WANT YOU - Dead or Alive-! You have just robbed a bank and are now chased by the sheriff. Watch out for his soldiers! 

Jump from rooftop to rooftop and punch them away. Quench your thirst for even more money by collecting plenty of coins on your escape.

